import React from 'react'

const Navigtn = ({filterItem,NewData}) => {
    return (
        <>
         <nav className="navbar">
          <div className="btn-group">
          <button className="btn-group__item" onClick={()=>setMenuData()} >
                    Home
                </button>
          {NewData.map((curr)=>{
            
            return(
                <button className="btn-group__item" onClick={()=>filterItem(curr)} >
                    {curr}
                </button>
              )
        })}

          </div>
          </nav>  
        </>
    )
}

export default Navigtn
